elements.expression:
markdown "Monthly Revenue Report - " { date | formatdate 'MMM YYYY'}| render css=".canvas__element p {
font-size:150%;
color:white;
text-align:left;
text-transform: uppercase;
}"

filters | demodata | sort "time" | mapColumn "time" fn=${getCell "time" | math "value + 33400000000"} | ply by="time" fn=${math "round(random() * 10)" | as "value"} | mapColumn "time" fn=${getCell "time" | rounddate "YYYY-MM"} | alterColumn "time" type="date" | pointseries x="time" y="sum(value)" text="sum(value)" | plot defaultStyle={seriesStyle points="0" bars=2000000000 stack=1 color="rgba(255,255,255,0)"} | render css=".valueLabel {
 margin-top: 20px;
 margin-left: 1px;
 color: #427af4;
 font-size: 1.1em;
}

.flot-tick-label {
  font-size: 1.2em !important;
  margin-top: -20px;
  margin-left: -5px;
  opacity: 0.8;
}

.legend {
  display: none;
}

.flot-y-axis .tickLabel {
  display: none;
}

.flot-x-axis .tickLabel{
  color: white;
}
"

filters | demodata | mapColumn "goal" fn=${if {getCell "state" | compare "eq" to="running"} then="fill" else="nofill"} | ply by="goal" fn=${math "random()*12+5" | as "value"} | pointseries color="goal" size="mean(value)" | pie hole=50 palette={palette "#0c56f7" "#427af4" "#8eb2ff" gradient=true} | render css=".pieLabel {
  display: none;
}"

markdown "MoM Bookings"| render css=".canvas__element p {
font-size:125%;
color:white;
text-align:left;
}"

markdown "72%" | render css=".canvas__element p {
font-size: 6em;
color:#427af4;
text-align:center;
font-weight:bold;
}"

markdown "TO MONTHLY GOAL"| render css=".canvas__element p {
font-size:125%;
color:#427af4;
text-align:center;
font-weight:bold;
}"
